USE TSQLV4;
SELECT orderid, custid, empid, orderdate, freight
FROM Sales.Orders;

USE Northwinds2022TSQLV7;
SELECT [OrderId], [CustomerId], [EmployeeId], [OrderDate], [Freight]
FROM [Northwinds2022TSQLV7].[Sales].[Order];

USE TSQLV4;
SELECT orderid, empid, orderdate, freight
FROM Sales.Orders
WHERE custid = 71;

USE Northwinds2022TSQLV7;
SELECT [OrderId], [EmployeeId], [OrderDate], [Freight]
FROM [Northwinds2022TSQLV7].[Sales].[Order]
WHERE [CustomerId] = 71;

USE TSQLV4;
SELECT empid, YEAR(orderdate) AS orderyear
FROM Sales.Orders
WHERE custid = 71
GROUP BY empid, YEAR(orderdate);

USE Northwinds2022TSQLV7;
SELECT [EmployeeId], YEAR([OrderDate]) AS orderyear
FROM [Northwinds2022TSQLV7].[Sales].[Order]
WHERE CustomerId = 71
GROUP BY [EmployeeId], YEAR([OrderDate]);

USE TSQLV4;
SELECT empid, YEAR(orderdate) AS orderyear
FROM Sales.Orders
WHERE custid = 71
GROUP BY empid, YEAR(orderdate)
HAVING COUNT(*) > 1;

USE Northwinds2022TSQLV7;
SELECT [EmployeeId], YEAR([OrderDate]) AS orderyear
FROM [Northwinds2022TSQLV7].[Sales].[Order]
WHERE [CustomerId] = 71
GROUP BY [EmployeeId], YEAR([OrderDate])
HAVING COUNT(*) > 1;

USE TSQLV4;
SELECT orderid orderdate
FROM Sales.Orders;

USE Northwinds2022TSQLV7;
SELECT [OrderId] [OrderDate]
FROM [Northwinds2022TSQLV7].[Sales].[Order];

USE TSQLV4;
SELECT empid, YEAR(orderdate) AS orderyear, COUNT(*) AS numorders
FROM Sales.Orders
WHERE custid = 71
GROUP BY empid, YEAR(orderdate)
HAVING COUNT(*) > 1;

USE Northwinds2022TSQLV7;
SELECT [EmployeeId], YEAR([OrderDate]) AS orderyear, COUNT(*) AS numorders
FROM [Northwinds2022TSQLV7].[Sales].[Order]
WHERE [CustomerId] = 71
GROUP BY [EmployeeId], YEAR([OrderDate])
HAVING COUNT(*) > 1;

USE TSQLV4;
SELECT orderid, YEAR(orderdate) AS orderyear
FROM Sales.Orders
WHERE YEAR(orderdate) > 2015;

USE Northwinds2022TSQLV7;
SELECT [OrderId], YEAR([OrderDate]) AS orderyear
FROM [Northwinds2022TSQLV7].[Sales].[Order]
WHERE YEAR([OrderDate]) > 2015;

USE TSQLV4;
SELECT empid, YEAR(orderdate) AS orderyear, COUNT(*) AS numorders
FROM Sales.Orders
WHERE custid = 71
GROUP BY empid, YEAR(orderdate)
HAVING COUNT(*) > 1;

USE Northwinds2022TSQLV7;
SELECT [EmployeeId], YEAR([OrderDate]) AS orderyear, COUNT(*) AS numorders
FROM [Northwinds2022TSQLV7].[Sales].[Order]
WHERE [CustomerId] = 71
GROUP BY [EmployeeId], YEAR([OrderDate])
HAVING COUNT(*) > 1;
